import { Box, Link } from "@chakra-ui/core";

const NavBar = () => {
  return (
    <Box p={3} w="80vw" color="white" bg="gray.600" boxShadow="md">
      <Link href="/">Home</Link>
      <Link href="/user">Profile</Link>
      <Link href="/stats">Stats</Link>
    </Box>
  );
};

export default NavBar;
